import { useState } from 'react';
import { Link } from 'react-router-dom';

function Signup() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [passwordValidation, setPasswordValidation] = useState('');
  const [confirmPwdMsg, setConfirmPwdMsg] = useState('');
  const [register, setRegister] = useState(false);
  const [message, setMessage] = useState('');
  const [apiError, setApiError] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    if (password !== confirmPassword) {
      setConfirmPwdMsg('Passwords do not match');
      return;
    }
    setConfirmPwdMsg('');
    fetch('http://localhost:8000/api/regi', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ username, email, password }),
    })
      .then((response) => {
        if (response.ok) {
          setRegister(true);
          setMessage('Successfully signed up! Please wait while you are redirected to the login page...');
          setTimeout(() => {
            navigate('/login');
          }, 1500);
        }
      })
      .catch((error) => {
        console.error(error);
        setApiError('An error occurred while signing up. Please try again.');
      });
  };

  const handleUsernameChange = (event) => {
    setUsername(event.target.value);
  };

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
    if (event.target.value.length < 6) {
      setPasswordValidation('Password should be at least 6 characters long');
    } else {
      setPasswordValidation('');
    }
  };

  const handleConfirmPasswordChange = (event) => {
    setConfirmPassword(event.target.value);
    if (event.target.value !== password) {
      setConfirmPwdMsg('Passwords do not match');
    } else {
      setConfirmPwdMsg('');
    }
  };

  return (
    <div>
      {register ? (
        <div>
          <h4>{message}</h4>
        </div>
      ) : (
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="username">Username:</label>
            <br />
            <input type="text" id="username" value={username} onChange={handleUsernameChange} />
          </div>
          <div>
            <label htmlFor="email">Email:</label>
            <br />
            <input type="email" id="email" value={email} onChange={handleEmailChange} />
          </div>
          <div>
            <label htmlFor="password">Password:</label>
            <br />
            {passwordValidation && <span>{passwordValidation}</span>} <br />
            <input type="password" id="password" value={password} onChange={handlePasswordChange} />
          </div>
          <div>
            <label htmlFor="password">Confirm Password:</label>
            <br />
            {confirmPwdMsg && <span>{confirmPwdMsg}</span>} <br />
            <input type="password" id="confirmPassword" value={confirmPassword} onChange={handleConfirmPasswordChange} />
          </div>

          {apiError && <h4>{apiError}</h4>}
          <div>
          <button type="submit">Signup</button>
                    <h5>Already Have an Account?</h5>
                    <Link to="/login">Login</Link>
                </div>
            </form>
      )};
        </div>

    )};

    export default Signup;
